import Script from '../dist/esm/src/script/Script.js'
import { toArray } from '../dist/esm/src/primitives/utils.js'
import { runBenchmark } from './lib/benchmark-runner.js'

const bigScriptHex = ''

async function main () {
  await runBenchmark('Big script round trip', () => {
    toArray(bigScriptHex, 'hex')
    const s = Script.fromHex(bigScriptHex)
    s.toBinary()
    s.toHex()
  }, {
    minSampleMs: 350,
    samples: 9
  })
}

main().catch((err) => {
  console.error(err)
  process.exit(1)
})
